import React, { useState } from 'react';
import App from './App';
import { BrowserRouter, Routes, Route, } from "react-router-dom";
import Hamburger from './Hamburger';
import Flip from './Flip';
import Game from './Game';

function ProtectedRoute(props) {
    return (
        <Route path="game" element={
            props.authorized ?
            props.protectedElement :
            props.alternateElement
        } />
    );
};

function Router() {
    const [playerData, changePlayerData] = useState({'name': null, 'wallet': null, 'side': null, 'bet': null});

    return (
        <BrowserRouter className="PlayOptions">
            <Routes>
                <Route path="/" element={<App playerData={playerData} changePlayerData={changePlayerData} />} />
                <Route path="flip" element={<Flip playerData={playerData} changePlayerData={changePlayerData} />} />
                <Route path="create" element={<Hamburger />} />
                <Route path="join" element={<Hamburger />} />
                <ProtectedRoute path="game" authorized={playerData.name !== null} protectedElement={<Game playerData={playerData} changePlayerData={changePlayerData} />} alternateElement={<App playerData={playerData} changePlayerData={changePlayerData} />}/>
            </Routes>
        </BrowserRouter>
    );
};

export default Router;
